    "fergus-falls-wetland-management-district-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Fergus
    Falls National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan and management planning. Refuge administration is outlined; information
    about personnel, youth programs, manpower programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, haying, fire management, pest
    control, wilderness areas, WPA easements, and private lands. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    and animal control. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, trapping, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, communication systems, and energy conservation. Cooperative programs
    and items of interest are provided at the end.",nt"license_title": "License
